



The development of type II diabetes requires impaired beta-cell function. Chronic hyperglycemia has been shown to induce multiple defects in beta-cells. Hyperglycemia has been proposed to lead to large amounts of reactive oxygen species (ROS) in beta-cells, with subsequent damage to cellular components including PDX-1. Loss of PDX-1, a critical regulator of insulin promoter activity, has also been proposed as an important mechanism leading to beta-cell dysfunction.
Although there is little doubt as to the importance of genetic factors in type II diabetes, genetic analysis is difficult due to complex interaction among multiple susceptibility genes and between genetic and environmental factors. Genetic studies have therefore given very diverse results. Kir6.2 and IRS are two of the candidate genes. It is known that Kir6.2 and IRS play central roles in insulin secretion and insulin signal transmission, respectively.
Source: KEGG","http://www.wikipathways.org/instance/WP1584","class",NULL);

This pathway is a prion disease pathway, that describes what happens when there is a mutation in the PRNP gene. The left part of the pathway represents the pathway retrieved from literature and the right part of the pathway represents data found using databases. The left part shos the interaction of pathological prion protein with an unknown receptor protein, this interaction activates a signalling pathway. The endoplasmic reticulum releases calcium and ER stress is induced. Activation of Caspase 12 by ER-stress is followed by cleavage and activation of the executioner Caspase-3, causing neuronal apoptosis. According to the databases, NCAM-1 can initiate two mechanisms: the activation of FGFR and formation of intracellular signalling complexes. NCAM-1 interacts with Fyn and FAK, resulting in phosphorylation of these two tyrosine kinases. Phosphorylation of Fyn and FAK results in activation of MAPK, ERK1 and 2, cAMP response element binding protein (CREB) and transcription factors ELK and NFkB. CREB activates transcription of genes which are important for axonal growth, survival, and synaptic plasticity in neurons.","http://www.wikipathways.org/instance/WP3995","instance","neuron;neuron");

Sources: Wikipedia:Cell cycle, KEGG","http://www.wikipathways.org/instance/WP179","class",NULL);








